import React from "react";
import { useContext } from "react";
import { DogContext } from "../Context/ContextProvider";

const DogsPage = () => {

  return (
    <div>
      <section className="dogs mt-3">
        <div className="row">
          {dogs &&
            dogs.map((dog) => {
              return (
                <div key={dog.id} className="col-md-3">
                  <div className="card mb-3" style={{height: '450px'}}>
                    <div className="dogs-img-container">
                    <img
                      style={{height: '200px', objectFit: 'cover'}}
                      className="card-img-top dog-img"
                      src={dog.imageUrl}
                      alt={dog.name}
                    />
                    </div>
                    <div className="card-body dogs-info">
                      <h4 className="card-title">{dog.name}</h4>
                      <p className="card-text dogs-des">{dog.description}</p>
                      <p className="card-text dogs-price">${dog.price}</p>
                      <button className="dogs-btn btn btn-success">Add to Cart</button>
                    </div>
                  </div>
                </div>
              );
            })}
        </div>
      </section>
    </div>
  );
};

export default DogsPage;
